%script

/* run 버튼을 클릭해서 실행하거나 [shift + Enter] 단축키를 사용하여 실행합니다.*/

BEGIN

execute immediate 'create or replace view credit_scoring_100k_v as select * from admin.credit_scoring_100k';

execute immediate 'create or replace view credit_scoring_new_cust_v as select * from admin.credit_scoring_100k sample (10)';

end;

%sql 

/*  run 버튼을 클릭해서 실행하거나 [shift + Enter] 단축키를 사용하여 실행합니다. */

select column_name from user_tab_cols where table_name='CREDIT_SCORING_100K_V';

%sql

/* 좋은 신용도를 가진 고객을 판가름 하기 위해 다음과 같은 고객 정보를 사용합니다. */

Select * from credit_scoring_100k_v where rownum < 100

%sql 

/* 이것은 Zepplin의 차트 시각화의 기본 예제입니다. 가장 기존적인 막대 그래프입니다. 아래의 'setting' 링크를 클릭하십시오. 그러면 차트를 만드는 데 사용 된 컬럼이 표시됩니다. 원하는 컬럼(field)을 드래그&드롭으로 가져다 놓고 시각화를 변경할 수 있습니다. */

select customer_id, age, income, tenure, loan_type, loan_amount, occupation, number_of_current_accounts, max_cc_spent_amount, mode_job_of_contacts from credit_scoring_100k_v where rownum < 1000

%script

/* 모든 수치 값(number 형 타입) 컬럼에 대한 bin값을 담는 view를 생성하는 프로시저를 실행합니다. */

BEGIN

BEGIN 
EXECUTE IMMEDIATE 'DROP TABLE bin_num_tbl';
EXCEPTION WHEN OTHERS THEN NULL; 
END; 

BEGIN
EXECUTE IMMEDIATE 'DROP VIEW mining_data_bin_view';
EXCEPTION WHEN OTHERS THEN NULL; 
END; 

   dbms_data_mining_transform.create_bin_num(
           bin_table_name     => 'bin_num_tbl');

   dbms_data_mining_transform.insert_autobin_num_eqwidth( --열에 따라 binning 개수를 다르게 가져감
           bin_table_name     => 'bin_num_tbl',
           data_table_name    => 'CREDIT_SCORING_100K_V',
           bin_num            => 5, --최소 bin 수
           max_bin_num        => 10, --최대 bin 수
           exclude_list       => dbms_data_mining_transform.COLUMN_LIST('CUSTOMER_ID')); --제외할 컬럼 명시, 지정하지 않으면 모든 수치 컬럼이 binning 됨.

  dbms_data_mining_transform.xform_bin_num(
           bin_table_name      => 'bin_num_tbl',
           data_table_name     => 'CREDIT_SCORING_100K_V',
           xform_view_name     => 'mining_data_bin_view');
END;

%sql

/* Note: Typically data scientists shold explore their data to make sure it makes sense and matches the data they believe they are working with. */

select customer_id, age, income, tenure, loan_type, loan_amount, occupation, education_level from mining_data_bin_view;

%script
/* CREDIT_SCORE_BIN(신용도)에 가장 영향을 미치는 중요한 컬럼 및 속성들을 찾아냄 */

DECLARE
v_sql varchar2(100);

BEGIN
BEGIN EXECUTE IMMEDIATE 'DROP TABLE ai_explain_output_credit_score_bin';
EXCEPTION WHEN OTHERS THEN NULL; 
END;

--EXPLAIN 프로시저 : target column 에 영향을 미치는 영향도 순서로 속성들을 RANK 함.
BEGIN
  DBMS_PREDICTIVE_ANALYTICS.EXPLAIN(
    data_table_name     => 'CREDIT_SCORING_100K_V',
    explain_column_name => 'CREDIT_SCORE_BIN',
    result_table_name   => 'AI_EXPLAIN_OUTPUT_CREDIT_SCORE_BIN');
END;

End;

%script 

