DECLARE
v_sql varchar2(100);

BEGIN

BEGIN EXECUTE IMMEDIATE 'DROP TABLE ai_explain_output_MAX_CC_SPENT_AMOUNT';
EXCEPTION WHEN OTHERS THEN NULL; 
END;

BEGIN
  DBMS_PREDICTIVE_ANALYTICS.EXPLAIN(
