%sql
-- 이거 적용할 때 위에서 전처리한 값들로 모델을 만들어야 하지 않을까.... 전처리 안한 데이터로 모델을 만드네? 그래서 PREP_AUTO를 사용한 것인가...

declare
v_sql varchar2(100);

BEGIN
    BEGIN
        v_sql := 'DROP TABLE n1_build_settings PURGE';
        EXECUTE IMMEDIATE v_sql;
        DBMS_OUTPUT.PUT_LINE (v_sql || ': succeeded');
        EXCEPTION
        WHEN OTHERS THEN
        DBMS_OUTPUT.PUT_LINE (v_sql || ': drop unneccessary - no table exist');
    END;

    BEGIN
        v_sql := 'CALL DBMS_DATA_MINING.DROP_MODEL(''N1_CLASS_MODEL'')';
        EXECUTE IMMEDIATE v_sql;
        DBMS_OUTPUT.PUT_LINE (v_sql || ': succeeded');
        EXCEPTION
        WHEN OTHERS THEN
        DBMS_OUTPUT.PUT_LINE (v_sql || ': drop unneccessary - no model exist');
    END;
    
    BEGIN
        v_sql := 'DROP TABLE N1_APPLY_RESULT PURGE';
        EXECUTE IMMEDIATE v_sql;
        DBMS_OUTPUT.PUT_LINE (v_sql || ': succeeded');
        EXCEPTION
        WHEN OTHERS THEN
        DBMS_OUTPUT.PUT_LINE (v_sql || ': drop unneccessary - no table exist');
    END;
    
    BEGIN
        v_sql := 'DROP TABLE N1_LIFT_TABLE PURGE';
        EXECUTE IMMEDIATE v_sql;
        DBMS_OUTPUT.PUT_LINE (v_sql || ': succeeded');
        EXCEPTION
        WHEN OTHERS THEN
        DBMS_OUTPUT.PUT_LINE (v_sql || ': drop unneccessary - no table exist');
    END;
    
    /* 데이터를 N1_TRAIN_DATA - 60% 와 N1_TEST_DATA - 나머지 40%로 나눈다. */
    EXECUTE IMMEDIATE 'CREATE OR REPLACE VIEW N1_TRAIN_DATA AS SELECT * FROM CREDIT_SCORING_100K_v SAMPLE (60) SEED (1)';
    dbms_output.put_line ('Created N1_TRAIN_DATA');
    EXECUTE IMMEDIATE 'CREATE OR REPLACE VIEW N1_TEST_DATA AS SELECT * FROM CREDIT_SCORING_100K_v MINUS SELECT * FROM N1_TRAIN_DATA';
    dbms_output.put_line ('Created N1_TEST_DATA');
    
    /*모델 build하기 위해 설정값을 담는 table을 만들고 관련한 파라미터 값을 넣는다.*/
    EXECUTE IMMEDIATE 'CREATE TABLE n1_build_settings (setting_name VARCHAR2(30), setting_value VARCHAR2(4000))';
    EXECUTE IMMEDIATE 'INSERT INTO n1_build_settings (setting_name, setting_value) values(''ALGO_NAME'', ''ALGO_DECISION_TREE'')';
    EXECUTE IMMEDIATE 'INSERT INTO n1_build_settings (setting_name, setting_value) values(''PREP_AUTO'', ''ON'')';    
    --PREP_AUTO를 사용하면 모델에서 휴리스틱을 사용하여 알고리즘 요구 사항에 따라 빌드 데이터를 변환합니다. PREP_AUTO 대신 사용자는 PREP_SCALE*및 PREP_SHIFT*설정 을 사용하여 데이터가 사용자 요구에 맞게 이동되거나 확장되도록 요청할 수 있습니다 .
    DBMS_OUTPUT.PUT_LINE('Created model build settings table: n1_build_settings ');
    
        /*
    -- 모델에 default 세팅 값이 아니라 customizing 하여 파라미터를 적용하고 싶다면 아래를 활용하세요 
    EXECUTE IMMEDIATE 'INSERT INTO n1_build_settings VALUES (''TREE_TERM_MAX_DEPTH'', 7)';
    EXECUTE IMMEDIATE 'INSERT INTO n1_build_settings VALUES (''TREE_TERM_MINREC_SPLIT'', 20)';
    EXECUTE IMMEDIATE 'INSERT INTO n1_build_settings VALUES (''TREE_TERM_MINPCT_SPLIT'', .1)';
    EXECUTE IMMEDIATE 'INSERT INTO n1_build_settings VALUES (''TREE_TERM_MINREC_NODE'', 10)';
    EXECUTE IMMEDIATE 'INSERT INTO n1_build_settings VALUES (''TREE_TERM_MINPCT_NODE'', 0.05)';
    */
    
    /*Classification Model build 하기, 여기서 TARGET_COLUMN_NAME은 CREDIT_SCORE_BIN 컬럼이다. 이 컬럼이 고객의 신용도를 나타내는 컬럼 - Good Credit과 Other Credit 두개의 cardinality 를 가진다.*/
    EXECUTE IMMEDIATE 'CALL DBMS_DATA_MINING.CREATE_MODEL(''N1_CLASS_MODEL'', ''CLASSIFICATION'', ''N1_TRAIN_DATA'', ''CUSTOMER_ID'', ''CREDIT_SCORE_BIN'', ''n1_build_settings'')';
    DBMS_OUTPUT.PUT_LINE('Created lift result: N1_LIFT_TABLE ');
    
    /*testing data로 모델 적용 및 모델 평가를 위한 lift 값 산출하기 */
    -- lift는 binary classification 모델에 대한 평가 metric 입니다. lift에 대한 자세한 설명은 아래를 참조
    EXECUTE IMMEDIATE 'CALL DBMS_DATA_MINING.APPLY(''N1_CLASS_MODEL'', ''N1_TEST_DATA'', ''CUSTOMER_ID'', ''N1_APPLY_RESULT'')';
    DBMS_OUTPUT.PUT_LINE('Created apply result: N1_APPLY_RESULT ');

    EXECUTE IMMEDIATE 'CALL DBMS_DATA_MINING.COMPUTE_LIFT(''N1_APPLY_RESULT'', ''N1_TEST_DATA'', ''CUSTOMER_ID'', ''CREDIT_SCORE_BIN'', ''N1_LIFT_TABLE'', ''Good Credit'', ''PREDICTION'', ''PROBABILITY'', 100)';
    DBMS_OUTPUT.PUT_LINE('Created apply result: N1_LIFT_TABLE ');    
    
END;
/

%script
