%sql

/*  부자이고, 수입이 2000 이며 고객 등급이 Silver 인 고객의 신용도를 평가해 봅시다. 값을 변화시키면서 다른 고객들의 신용도도 평가해 봅시다.*/

select prediction_probability(N1_CLASS_MODEL, 'Good Credit' 
  USING 'Rich' as WEALTH, 2000 as income, 'Silver' as customer_value_segment) Prediction_Probability
from dual;

%sql 
/* NOTE:  lab 400 시작 하기 전에 반드시 view를 업데이트 해야 합니다.
 좋은 신용도에 대한 확률을 담는 컬럼을 추가하여 추후 분석에서 사용합니다. */

create or replace view credit_scoring_100k_v as select a.prob_good_credit, b.*
from credit_score_new_predictions a, admin.credit_scoring_100k b
where a.customer_id = b.customer_id;
